import React from 'react';
import Header from "../Header";
import Footer from "../Footer";
import Films from "../Films";



const Film = () => {
    return (
        <div>
            <Header/>
            <section className="films container">
                <Films title={"Słowacja/Węgry 05.2022"} link={"https://studio.youtube.com/video/JUZTT_6GJrM/edit"} text={"Wyjazd na Węgry, po drodze spotkałem Adriana z kanału Motopodhale. Zwiedziłem między innymi takie miejsca jak Eger, Słowacki Raj jak i nasze Morskie Oko."} image={"https://i.ytimg.com/an_webp/JUZTT_6GJrM/mqdefault_6s.webp?du=3000&sqp=CKns3JwG&rs=AOn4CLDEqhYmhvlWMZSOZ2LWE2kvPgbQUg"}/>
                <Films title={"Wyjazd do Białej Podlaskiej 06.2020"} text={"Wypad z Łukaszem na jego Derbi Terra 125. Przejazd przez jezioro Białe, Białą Podlaskę i camping nad Wiłą pod Puławami."} image={"https://i9.ytimg.com/vi_webp/ye3xnsuUK-Y/mqdefault.webp?v=5fc4af52&sqp=CPDO3ZwG&rs=AOn4CLBdcResAy5f95PU5BomBADqPnFfPw"}/>
                <Films title={"Wyjazd do Zakopanego 06.2020"} text={"Szybki 2 dniowy wyjazd do Zakopanego z chłopakami z Lublina, zwiedżanie okolic Zakopca."} image={"https://i9.ytimg.com/vi_webp/alDD2hn4-ss/mqdefault.webp?sqp=CPDO3ZwG&rs=AOn4CLBdip8tsFAIwfLqOvtsFTU2a3gRFQ"}/>
                <Films title={"Offroad'owy wyjazd do Gdaśka 05.2020"} text={"Wyjazd głównie w off'ie. Jechalem z Michałem na jego nowym bmw 850gs adv."} image={"https://i9.ytimg.com/vi_webp/wcm88SMwu-c/mqdefault.webp?v=5f0e97f5&sqp=CPDO3ZwG&rs=AOn4CLAilY3Uyw5QrvasEJkA_crHAyD7pg"}/>
                <Films title={"Offroad z grupa z grupą z Tczewa. 09.2019"} text={"Wyjazd dużą ekipą po okolicach Tczewa. Chłopaki i dziewczyny dobrze nakręceni na off'y :D."} image={"https://i9.ytimg.com/vi_webp/JQ3a1ZPf1I8/mqdefault.webp?v=5dc95705&sqp=CPDO3ZwG&rs=AOn4CLDjZdp-4TxZD_VwlKaFZjw8o5aDJw"}/>
                <Films title={"Zlot Lesko 08.2019"} text={"Jeden z pierwszych wyjazdów na zlot motocyklowy. Bardzo duża ilość fajnych wspomnień. Jechałem z Krystianem na jego Hondzie Cbf 600."} image={"https://i9.ytimg.com/vi_webp/ImlcwK0InLI/mqdefault.webp?sqp=CPDO3ZwG&rs=AOn4CLCI4cqoLxi-AoXVV5e-uldGvp3Q7g"}/>
                <Films title={"Jazda wokół Lublina/Radawczyka 05.2019"} text={"Spontaniczny wypad z Adamem i Łukaszkiem. Troche off'u głóœnie kręcenie sie wokół komina."} image={"https://i9.ytimg.com/vi/Uo6CiFwCUHY/mqdefault.jpg?sqp=CPDO3ZwG-oaymwEmCMACELQB8quKqQMa8AEB-AHUBoAC4AOKAgwIABABGGUgXihXMA8=&rs=AOn4CLCAq1bQ5x-Hstn8NE6bfk9U3uqbXA"}/>
                <Films title={"Pierwszy wyjazd w off'ie. Zwiedzanie bunkrów w okolic Warszawy 04.2019"} text={"Pierwszy mój wyjazd w offroadzie a zarazem pierwszy wyjazd na którym połamałem conajmniej 4 elementy motorcykla. Dużo wywrotek dużo dobrych wspomnień."} image={"https://i9.ytimg.com/vi_webp/ssLG1rosq5Y/mqdefault.webp?sqp=CPDO3ZwG&rs=AOn4CLDHHmrwz3ZPuhHaSou9TXejRy1Etw"}/>
            </section>
            <Footer/>
        </div>
    );
};

export default Film;
